- This requires accumulating into a temporary buffer of a
  higher-precision type (float) to maintain precision. Implementing
  this required some minor refactoring which inflates the diff a bit.","distinct":true,"url":"https://api.github.com/repos/icpm/tensorflow/commits/ab890020bb3b1e359a80a709c66cd7e6f76b9082"},{"sha":"2792278e7d9d65d6d3e3050a8b3691f8c698d6d5","author":{"name":"Deven Desai","email":"bbcec020b514464468c6a99414de2031b1a0cc8b@gmail.com"},"message":"Add NHWC layout support when creating miopenTensorDescriptor for conv filter

Prior to this commit the code in `rocm_dnn.cc` which creates `miopenTensorDescriptor` for the convolution filter worked only for NCHW layout. Making it work for NHWC layout requires passing the correct tensor "stride" format in a manner expected by MIOpen.

Copy-pasting a comment from this commit which explains the data + format that MIOpen expects in the call to `miopenSetTensorDescriptor`

```
    // We need to pass two vectors to the miopenSetTensorDescriptor routine
    // "dims" (length == number of dims, elem value == dimension size)
    // "strides" (length == number of dims, elem value == stride size)
    //
    // Irrespective of the actual filter layout, the indexing of both those
    // vectors must be the following (coz that is what MIOpen expects)
    // dims[0] = strides[0] = N or output
    // dims[1] = strides[1] = C or input
    // dims[2] = strides[2] = H or spatial dim 0
    // dims[3] = strides[3] = W or spatial dim 1
    //
    // assume you have a tensor with dimensions
    // batch descriptor name    filter descriptor name    value
    //   N (batch size)            O (output features)    256
    //   C (channels)              I (input features)       3
    //   H (height)                H (height)               7
    //   W (width)                 W (width)                5
    //
    // The content of "dims" will be the same irrespective of layout
    // layout (NCHW or NHWC), and MIOpen expects it should be
    //                           NCHW layout   NHWC layout
    // dims[0] = size of N dim =    256           256
    // dims[1] = size of C dim =      3             3
    // dims[2] = size of H dim =      7             7
    // dims[3] = size of W dim =      5             5
    //
    // The content of "strides" will be different based on layout
    //                                  NCHW layout   NHWC layout
    //  strides[0] = stride of N dim =     7x5x3       7x5x3
    //  strides[1] = stride of C dim =     7x5         1
    //  strides[2] = stride of H dim =     5           5x3
    //  strides[3] = stride of W dim =     1           3
```","distinct":true,"url":"https://api.github.com/repos/icpm/tensorflow/commits/2792278e7d9d65d6d3e3050a8b3691f8c698d6d5"},{"sha":"3bbc53cd5e4fc5eabdfa66df5d37f31e408e9435","author":{"name":"Deven Desai","email":"bbcec020b514464468c6a99414de2031b1a0cc8b@gmail.com"},"message":"Removing the no-longer applicable NHWC --> NCHW transform in rocm_dnn.cc

It seems that right before we call the MIOpen Conv APIs to do bwd-data/bwd-filter we have a call to do NHWC --> NCHW transform on the output (of the forward pass ? ). This code seems to be something that we copied over from the original TF implementation, and it never triggered, because the output layout was always NCHW.

But now that we are laying the groundwork for using MIOpen APIs that support NHWC layout, this transform gets triggerred and leads to incorrect behaviour + results. This commit simply deletes that un-needed code.","distinct":true,"url":"https://api.github.com/repos/icpm/tensorflow/commits/3bbc53cd5e4fc5eabdfa66df5d37f31e408e9435"},{"sha":"5068e223af1a142b7dc524a49ad796154653f6fe","author":{"name":"Kaixi Hou","email":"edaff5a4cab35408d68c643283259ec28622ef39@nvidia.com"},"message":"Change cudnn version macros","distinct":true,"url":"https://api.github.com/repos/icpm/tensorflow/commits/5068e223af1a142b7dc524a49ad796154653f6fe"},{"sha":"3e1f22d6ad7ae65dc8ebf9f4b2aa79964624eb5f","author":{"name":"Deven Desai","email":"bbcec020b514464468c6a99414de2031b1a0cc8b@gmail.com"},"message":"Addressing PR feedback : using a named struct instead of tuple as the return type for GetDimIndices","distinct":true,"url":"https://api.github.com/repos/icpm/tensorflow/commits/3e1f22d6ad7ae65dc8ebf9f4b2aa79964624eb5f"},{"sha":"1b11d091a81c4ec0ebeaa936354f5aa6a6f3de21","author":{"name":"Deven Desai","email":"bbcec020b514464468c6a99414de2031b1a0cc8b@gmail.com"},"message":"Addressing PR feedback : using absl::c_transform instead of std::transform","distinct":true,"url":"https://api.github.com/repos/icpm/tensorflow/commits/1b11d091a81c4ec0ebeaa936354f5aa6a6f3de21"},{"sha":"dd5056ca09d1a0765b0f3adf308cbb2d40b18dc9","author":{"name":"Kevin Cheng","email":"5e8088c0152dac7c33bfc7f63d675b9c49c0d301@arm.com"},"message":"Update TOSA MLIR legalization documentation

